import React from 'react';
import {Container, Row, Col, ListGroup, Card} from 'react-bootstrap'
import UpcomingTasks from '../sub-components/UpcomingTasks.js'
import RecentlyCompletedTasks from '../sub-components/UpcomingTasks.js'


export default class Tasks extends React.Component {
  constructor(){
    super();
    this.state = {
      date: new Date(),
    }
  }
  render(){
    console.log(this.props)
    return(
      <Container fluid>
        <Row>
          <Col sm={7}>
            <UpcomingTasks dateFromState={this.state.date} tasks={this.props.tasks.filter(task => !task.is_completed)} />
          </Col>
          <Col sm={5}>
            <Card>
            </Card>
          </Col>
        </Row>
      </Container>
    )
  }
}
